import logo from "../../logo.svg";
const InfoServices = [
  {
    id: 1,
    type: "Endurance Training",
    label: "",
    text: "",
    imgSrc: { logo },
    path: "/service",
  },
  {
    id: 2,
    type: "Weight Training",
    label: "",
    text: "",
    imgSrc: "../../assets/men-figur.png",
    path: "/service",
  },
  {
    id: 3,
    type: "Personal Training",
    label: "",
    text: "",
    imgSrc: "../../assets/men-figur.png",
    path: "/service",
  },
  {
    id: 4,
    type: "Group Training",
    label: "",
    text: "",
    imgSrc: "../../assets/men-figur.png",
    path: "/service",
  },
];

export default InfoServices;
